import ExpenseItem from "./components/ExpenseItem/ExpenseItem";
import { expenses } from "./services/expenses";
function App() {

  return (
    <div>
      <h2>Let's get started!</h2>
      {expenses.map((expense, index) => (
        <ExpenseItem key={expense} data={expense} />
      ))}
    </div>
  );
}

export default App;
